import React from "react";

const ClickedSlotList = ({ meetingDateList }) => {
  const renderClickedList = (meetingList) => {
    let returnList = []; // [{1: [date1, date2, ...]}, {4: [date]}, ...]
    let datesPerMonth = [];
    let prevMonth = -1;
    for (let i = 0; i < meetingList.length(); i++) {
      const date = meetingList[i];
      let month = date.getMonth();
      if (month != prevMonth) {
        returnList.push({ prevMonth: datesPerMonth });
        datesPerMonth = [];
        prevMonth = month;
      } else {
        datesPerMonth.push(date);
      }
      if (i === meetingList.length() - 1) {
        returnList.push({ prevMonth: datesPerMonth });
      }
    }
    returnList.splice(0, 1); // remove {-1: []}
    console.log(returnList);
    return returnList;
  };

  return <>{renderClickedList(meetingDateList).map((monthAndDates)=>{
        for (const [m, ds] of Object.entries(monthAndDates)) {
            return (
              <div>
                <p>{m.toString()}</p>
                <div>
                  {ds.map((d) => (
                    <p>{d.toString()}</p>
                  ))}
                </div>
              </div>
            );
            }
        })}</>;
};

export default ClickedSlotList;
